import React, { useEffect, useDispatch } from "react";
import { transactionActions } from "../../Actions";

export default function TransactionPage() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(transactionActions.getAllProduct());
  }, [dispatch]);
  return <div></div>;
}
